    }



    return (
        <>
            <h1>사용자</h1>
            {loading ? <Loader /> : error ? <Message variant='danger'>{error}</Message>
            : (
                <Table striped bordered hover responsive className='tabl-sm'>
                  
                  <thead>
                    <tr>
                        <th>ID</th>
                        <th>이름</th>
                        <th>이메일</th>
                        <th>관리자</th>
                        <th></th>
                    </tr>
                  </thead>

               
                </Table>


            )}
        </>
    )
}

export default UserListScreen
